import React from 'react';
import logo from './logos/MyMixer.png';
import MixerLogo from './MixerLogo/MixerLogo'

const NavBar= () =>{
  return (
    <nav class="navbar justify-content-center navbar-expand-rg navbar-light bg-light">
      <a class="navbar-brand mr-sm-0" m href="">
        <img src={logo}/>
      </a>
        <li class="nav-item">
          <a class="nav-link" href="essentials">Essentials</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="faq">FAQ</a>
        </li>
    </nav>
  )
};
export default NavBar;
